async function checkUsageLimit(userId, usageType) {
    try {
        const response = await fetch('/api/usage?action=check', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json'
            },
            body: JSON.stringify({
                userId,
                usageType
            })
        });
        if (!response.ok) {
            throw new Error('Failed to check usage limit');
        }
        return await response.json();
    } catch (error) {
        console.error('Error checking usage limit:', error);
        throw error;
    }
}
async function incrementUsage(userId, usageType) {
    try {
        const response = await fetch('/api/usage?action=increment', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json'
            },
            body: JSON.stringify({
                userId,
                usageType
            })
        });
        const data = await response.json();
        if (response.status === 403 && data.limitReached) {
            return {
                success: false,
                limitReached: true
            };
        }
        if (!response.ok) {
            throw new Error('Failed to increment usage');
        }
        return data;
    } catch (error) {
        console.error('Error incrementing usage:', error);
        throw error;
    }
}
async function createCheckoutSession(userId, email) {
    try {
        const response = await fetch('/api/create-checkout-session', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json'
            },
            body: JSON.stringify({
                userId,
                email
            })
        });
        if (!response.ok) {
            throw new Error('Failed to create checkout session');
        }
        const data = await response.json();
        return data.url;
    } catch (error) {
        console.error('Error creating checkout session:', error);
        throw error;
    }
}
function getLimitMessage(usageType, currentUsage, usageLimit) {
    switch(usageType){
        case 'chat':
            return `You've used ${currentUsage} of ${usageLimit} chat prompts`;
        case 'image_gen':
            return `You've used ${currentUsage} of ${usageLimit} image generations`;
        case 'video_gen':
            return `You've used ${currentUsage} of ${usageLimit} video generations`;
    }
}
